import React, { Component } from 'react';
import './css/Home.css';

export class Home extends Component {

    render() {
        
        return (

            <div className="home">
                
                {this.props.items.phones.slice(0,3).map(phones =>{
                return <div key = {phones.id} className="row">
                            <h3> {phones.brand}</h3>
                        </div>
        })}

            </div>

        )
    }
}

export default Home;
